import React from 'react';

import BacklogCardsContainer from '../containers/CardsContainer';

const List = ({ list = {}, removeList }) => {
  return (
    <article className="List">
      <h2>{list.title}</h2>
      <BacklogCardsContainer listId={list.id} key={list.id} />
    </article>
  );
};

export default List;
